import React from 'react';
import {BrowserRouter as Router , Switch , Route,Link } from 'react-router-dom';

export default function Details() {
    return (
        <Router>
            <Switch>
                <Route path="/details" component={Details}/>
            </Switch>
        </Router>
    )
}
